import React from "react";
import {NavigationContainer} from "@react-navigation/native";
import {createStackNavigator} from '@react'
import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";
import LoginComp from "./components/login/loginComp";
import ForgotYourPasswordComp from "./components/login/forgotYourPasswordComp";
import SendEmail from "./components/login/sendEmailComp";

export default function App() {
  const Stack = createStackNavigator();
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Login">
        <Stack.Screen name="Login" component={LoginComp}/>
        <Stack.Screen name="Forgot your password" component={ForgotYourPasswordComp}/>
      </Stack.Navigator>
    </NavigationContainer>
    // <View style={styles.container}>
    //   <LoginComp></LoginComp>
    //   <ForgotYourPasswordComp></ForgotYourPasswordComp>
    //   {/* <SendEmail></SendEmail> */}
    //   <StatusBar style="auto" />
    // </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
